import React from "react";
import { Link } from 'react-router-dom'
import "./style.scss";
import { Component } from "react";

function truncateDescription({ desc }) {
	return desc.split(" ").splice(0, 14).join(" ");
}

class Project extends Component {
	render({ className, title, desc, image }){
		return (
			<Link to="/hult-edu">
				<div className={`project ${className}`}>
					<img className="project__image" src={image} alt="" title="" />
					<p className="project__title">{title}</p>
					<p className="project__desc">{this.truncateDescription()}</p>
				</div>
			</Link>
		)
	}
}

export default Project;
